let client =  $node["IF Task"].json["matches"][0].metadata["client"];

let kinCredits = $vars.startingKinCredits;

if (Object.keys($json.vectors).length > 0) {
  kinCredits = $json.vectors[client].metadata.kinCredits
}

let startDate = new Date($node["get body"].json["startTimestamp"]);

let elapsedTime = $now.toMillis() - startDate.getTime(); 

kinCredits = kinCredits - elapsedTime/60;

return {"kinCredits":kinCredits, "client":client};

$execution.customData.set("DOING", "true")

let json = {
  ...$node["IF Task"].json.matches[0].metadata,
  "startTimestamp" : $now,
  "sync" : false
};

return {"json": json};
